document.addEventListener('DOMContentLoaded', function () {

    $('select.select2_item').select2();

    $('select.select2_item_cl').select2({
        placeholder: 'Выберите или введите...',
        allowClear: true
    });

    const observer = new MutationObserver(function (mutations) {
        mutations.forEach(function (mutation) {
            mutation.addedNodes.forEach(function (node) {
                // Если добавленный узел имеет класс 'select2_item'
                if ($(node).hasClass('select2_item_cl')) {
                    $(node).select2({
                        placeholder: '',
                        allowClear: true
                    });
                }

                // Если узел содержит вложенные элементы <select> с классом 'select2_item'
                $(node).find('select.select2_item_cl').each(function () {
                    $(this).select2({
                        placeholder: '',
                        allowClear: true
                    });
                });
            });
        });
    });

    // Настройки для отслеживания изменений в DOM
    observer.observe(document.body, { childList: true, subtree: true });

});
